import React from 'react'

function ProductsItem({ name, description, image, price}) {
  return (
    <div className='justify-center items-center'>
        <img src={image} alt='name'/>
        <h3 className='text-center font-semibold md:text-2xl sm:text-1xl'>{name}</h3>
        <p className='text-center'>{description}</p>
        <p className='text-center'>{price}</p><br></br>

        <button className='bg-[#00df9a] w-[100px] rounded-md font-medium my-4 mx-auto py-3 text-black'>View More</button>

    </div>
  )
}

export default ProductsItem
